import './App.css';
import TextField from '@mui/material/TextField';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>THINGS TO DO</h1>
        <TextField id="outlined-basic" label="Add New" variant="outlined" style={{marginLeft:'20%', marginRight:'20%'}}/>
      </header>
    </div>
  );
}

export default App;
